const Home: React.FC = () => {
	const p = useParams();
	console.log(p);
	return (
		<div id="homePage">
			<NavBar />
			<Hero />
			<PopularRestaurants />
			<SignatureDish />
			<IconMenu />
			<ChefOfTheWeek />
			<AboutUs />
			<Footer />
		</div>
	);
};

export default Home;
